let bandSearch = true;

function showRecipes(array){

  const recipesArticles = document.createElement('div');

  array.forEach( (element) =>{
    const elementArticle = document.createElement('div');
    elementArticle.className = 'row';
    elementArticle.style.border = 'thick solid #ef6c00';

    const elementArticleTAR = document.createElement('div');
    elementArticleTAR.className = 'col-8';
    const elementArticleIMG = document.createElement('div');
    elementArticleIMG.className = 'col-4';

    const img = document.createElement('img');
    img.src = element.image;

    const rowArticleTitle = document.createElement('div');
    const divArticleTitle = document.createElement('div');
    divArticleTitle.className = 'col-12';
    const titleArticle = document.createElement('h3');
    titleArticle.innerHTML = element.title;
    titleArticle.style.color = 'white';

    const rowArticleDescription = document.createElement('div');
    const divArticleDescription = document.createElement('div');
    divArticleDescription.className = 'col-12';
    const descriptionArticle = document.createElement('p');
    descriptionArticle.innerHTML = element.description;
    descriptionArticle.style.color = 'white';

    const rowArticleIngredients = document.createElement('div')
    const divArticleIngredients = document.createElement('div');
    divArticleIngredients.className = 'col-12';
    const titleIngredients = document.createElement('h4');
    titleIngredients.innerHTML = 'Ingredientes';
    titleIngredients.style.color = 'white';
    const listIngredients = document.createElement('ol')
    element.ingredients.forEach( (el) => {
      const ing = document.createElement('li');
      ing.innerHTML = el.ingredient
      ing.style.color = 'white'
      listIngredients.appendChild(ing) ;
    });

    const rowArticleSteps = document.createElement('div')
    const divArticleSteps = document.createElement('div');
    divArticleSteps.className = 'col-12';
    const titleSteps = document.createElement('h4');
    titleSteps.innerHTML = 'Pasos a Seguir: ';
    titleSteps.style.color = 'white';
    const listSteps = document.createElement('ol')
    element.steps.forEach( (el) => {
      const st = document.createElement('li');
      st.innerHTML = el.step
      st.style.color = 'white'
      listSteps.appendChild(st) ;
    });

    divArticleSteps.appendChild(titleSteps);
    divArticleSteps.appendChild(listSteps);
    rowArticleSteps.appendChild(divArticleSteps);
    divArticleIngredients.appendChild(titleIngredients);
    divArticleIngredients.appendChild(listIngredients);
    rowArticleIngredients.appendChild(divArticleIngredients);
    divArticleDescription.appendChild(descriptionArticle);
    rowArticleDescription.appendChild(divArticleDescription);
    divArticleTitle.appendChild(titleArticle);
    rowArticleTitle.appendChild(divArticleTitle);

    elementArticleTAR.appendChild(rowArticleTitle);
    elementArticleTAR.appendChild(rowArticleDescription);
    elementArticleTAR.appendChild(rowArticleIngredients);
    elementArticleTAR.appendChild(rowArticleSteps);
    elementArticleIMG.appendChild(img);
    elementArticle.appendChild(elementArticleTAR);
    elementArticle.appendChild(elementArticleIMG);
    recipesArticles.appendChild(elementArticle);
  });

  return recipesArticles;
}

